processinfo.p:
Zoals reeds vermeld bij de aanwijzingen voor de gebruiker zijn in veel gevallen de bestaande dossieromschrijvingen overgenomen, op voorwaarde dat: 


de inhoud overeenkwam met deze dossieromschrijving;


de dossieromschrijvingen een meerwaarde geeft ten opzichte van de handeling;


de redactie uniform gemaakt werd.

odd.p:
Openbare archiefstukken kunnen online worden aangevraagd en gereserveerd. U kunt dit ook via de terminals in de studiezaal van het Nationaal Archief doen. Om te kunnen reserveren dient u de volgende stappen te volgen: 


U maakt een profiel aan op www.gahetna.nl, en logt vervolgens in;


Via de archiefinventaris (alleen de beschrijvingen met rode nummers) selecteert u het gewenste archiefstuk door op de knop 'Reserveren' te klikken;


In het volgende scherm geeft u aan op welke dag u het archiefstuk wilt inzien;


Indien u zich bevindt in de studiezaal en een tafelnummer heeft ontvangen kunt u dit nummer vermelden. Als u geen tafelnummer heeft kunt u tafelnummer 777 laten staan;


Vervolgens bevestigt u uw reservering door deze te versturen.

did.unittitle:
Het opstellen van de zgn. Miljoenennota, houdende:
- een nota inzake de toestand van de financiën van het rijk;
- een verzamelstaat inzake de totalen van alle hoofdstukken van de begroting van uitgaven;
- het totaal van de ramingstaat.

Het opstellen van de Miljoenennota, houdende:
- een nota betreffende de toestand van de financiën van het rijk, waarin mede zijn opgenomen beschouwingen over de betekenis van het voorgenomen beleid voor de volkshuishouding;
- ramingen voor vier op het begrotingsjaar volgende jaren.
